import React, { Component } from 'react';
import {Container, Accordion, Card} from "react-bootstrap";
import "./accordion.css";

export class ProjectAccordion extends Component {

    render() {

        let toggleOne = document.getElementById("toggleOne");
        let toggleTwo = document.getElementById("toggleOne");
        let toggleClassOne = "";
        let toggleClassTwo = "collapsed";

       if(toggleOne.classList.contains("show")){
           console.log("Show")
       }

        return (
            <Container>
                <div class="challange-solution-section">
                <Accordion class="panel-group" defaultActiveKey="0">
                        <div class="panel"> 
                        <Accordion.Toggle class="panel-heading" as={Card.Header} eventKey="0">
                        <a class={toggleClassOne}>The Challange Was</a>
                        </Accordion.Toggle>
                        <Accordion.Collapse id="toggleOne" eventKey="0">
                        <div class="panel-body">
                            <p>Lorem ipsum dolor sit amet consectetur adipisicing elit. At voluptate autem qui praesentium corporis doloremque eveniet illum quibusdam error, odit minus similique, repellendus laboriosam veritatis. Sapiente, quod eius, dignissimos quibusdam possimus dolore exercitationem facere nam, adipisci ipsum voluptatum error at.</p>
                        </div>
                        </Accordion.Collapse>
                        </div>
                        <div class="challange-solution-section">  
                        <div className="panel">

                        <Accordion.Toggle class="panel-heading" as={Card.Header} eventKey="1">
                        <a class={toggleClassTwo}>Our Solutions Was</a>
                        </Accordion.Toggle>
                        <Accordion.Collapse id="toggleTwo"  eventKey="1">
                        <div class="panel-body">
                            <p>Lorem ipsum dolor sit amet consectetur adipisicing elit. At voluptate autem qui praesentium corporis doloremque eveniet illum quibusdam error, odit minus similique, repellendus laboriosam veritatis. Sapiente, quod eius, dignissimos quibusdam possimus dolore exercitationem facere nam, adipisci ipsum voluptatum error at.</p>
                        </div>
                        </Accordion.Collapse>
                        </div>   
                        </div>
                    </Accordion>
                </div>
            </Container>
        )
    }
}

export default ProjectAccordion
